import React, { useState } from "react";
import Header from "./components/Header";
import TaskList from "./components/TaskList";
import Analytics from "./components/Analytics";
import ThemeSelector from "./components/ThemeSelector";
import Sidebar from "./components/Sidebar";  // Import Sidebar component
import { toggleTaskCompletion, setTaskPriority } from "./utils";
import "./styles/App.css";
import "./styles/TaskItem.css";

const App = () => {
  const [tasks, setTasks] = useState([]); // Start with an empty list of tasks
  const [filterStatus, setFilterStatus] = useState("all");
  const [theme, setTheme] = useState("light");
  const [searchQuery, setSearchQuery] = useState(""); // For search functionality
  const [selectedTab, setSelectedTab] = useState("today"); // Default tab

  // Toggle between dark and light mode
  const toggleDarkMode = () => {
    setTheme((prevTheme) => (prevTheme === "light" ? "dark" : "light"));
  };

  // Add new task
  const addTask = (title, priority) => {
    const newTask = {
      id: Date.now(), // unique task id based on timestamp
      title,
      completed: false,
      priority,
      dueDate: "", // Default empty due date
    };
    setTasks((prevTasks) => [...prevTasks, newTask]);
  };

  // Handle task completion toggle
  const handleToggleTask = (task) => {
    setTasks(tasks.map((t) => (t.id === task.id ? toggleTaskCompletion(t) : t)));
  };

  // Set task priority
  const handleSetPriority = (task, priority) => {
    setTasks(tasks.map((t) => (t.id === task.id ? setTaskPriority(t, priority) : t)));
  };

  // Handle task search
  const handleSearch = (query) => {
    setSearchQuery(query);
  };

  // Filter tasks based on search query
  const filteredTasks = tasks.filter((task) => task.title.toLowerCase().includes(searchQuery.toLowerCase()));

  // Filter tasks based on selected tab (Today, Upcoming, Filtered)
  const getTabFilteredTasks = () => {
    switch (selectedTab) {
      case "today":
        return tasks.filter((task) => task.dueDate === "today"); // Replace with actual logic
      case "upcoming":
        return tasks.filter((task) => task.dueDate && task.dueDate > "today"); // Replace with actual logic
      case "filtered":
        return filteredTasks; // Use filtered tasks for labeled tasks
      default:
        return tasks;
    }
  };

  return (
    <div className={theme === "dark" ? "dark-mode" : ""}>
      <div className="app-container">
        <Sidebar onSelectTab={setSelectedTab} />
        <div className="main-content">
          <header>
            <h1>CheckMate: An ADHD-Friendly To-Do List</h1>
            <div className="header-actions">
              <ThemeSelector onThemeChange={setTheme} />
              <input
                type="text"
                placeholder="Search Tasks"
                className="search-bar"
                value={searchQuery}
                onChange={(e) => handleSearch(e.target.value)}
              />
            </div>
          </header>
          <TaskList
            tasks={getTabFilteredTasks()} // Pass filtered tasks based on selected tab
            filterStatus={filterStatus}
            onToggleTask={handleToggleTask}
            onSetPriority={handleSetPriority}
          />
          <Analytics tasks={tasks} />
        </div>
      </div>
      <div className="task-input">
        <input
          type="text"
          placeholder="New Task"
          id="taskTitle"
          className="task-input-field"
        />
        <select id="taskPriority" className="priority-selector">
          <option value="high">High</option>
          <option value="medium">Medium</option>
          <option value="low">Low</option>
        </select>
        <button
          onClick={() => {
            const title = document.getElementById("taskTitle").value;
            const priority = document.getElementById("taskPriority").value;
            if (title) addTask(title, priority);
          }}
        >
          Add Task
        </button>
      </div>
    </div>
  );
};

export default App;
